import React from "react";
import styles from "./Skills.module.css"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGitAlt} from '@fortawesome/free-brands-svg-icons';
import { faJsSquare} from '@fortawesome/free-brands-svg-icons';

const Skills = () => {
    return (
        <div className={styles.display__skills}>
            <h1 className={styles.display__title}>Skills</h1>
            <div className={styles.display__skillTitles}>
                <button className={styles.tech__skills}>Technical Skills</button>
                <button className={styles.soft__skills}>Soft Skills</button>
            </div>
            <div className={styles.display__screen}>
                <div className={styles.git}>
                    <FontAwesomeIcon icon={faGitAlt} className={styles.git__logo} />
                    <span className={styles.git__name}>Git</span>
                </div>
                <div className={styles.git}>
                    <FontAwesomeIcon icon={faJsSquare} className={styles.git__logo} />
                    <span className={styles.git__name}>JavaScript</span>
                </div>
            </div>
        </div>
    );
} 

export default Skills;
